import React from 'react';
import ProgressSkills from "../ProgressSkills/ProgressSkills";


export default class Skills extends React.Component {
    constructor()
    {
        super();
    }
    render(){
        return(<>
            <div className='row'>
                <div></div>
            <ProgressSkills value="50" name="Html"/>
            </div>
            </>);
    }
}
